          const facultyList = document.getElementById("faculty-list");

          function renderFaculty(limit) {
            facultyList.innerHTML = "";
            facultyData.slice(0, limit).forEach(faculty => {
              const card = document.createElement("div");
              card.className = "teacher-card bg-gray-50 p-6 rounded-lg shadow-md text-center transition duration-300";
              card.innerHTML = `
                <div class="w-32 h-32 rounded-full overflow-hidden mx-auto mb-4 border-4 border-blue-100">
                  <img src="${faculty.image}" alt="${faculty.name}" class="w-full h-full object-cover">
                </div>
                <h3 class="text-xl font-bold">${faculty.name}</h3>
                <p class="text-blue-700 font-medium mb-2">${faculty.title}</p>
                <p class="text-sm text-gray-600 mb-3">${faculty.qualification}</p>
                <p class="text-sm italic text-gray-600">"${faculty.message}"</p>
              `;
              facultyList.appendChild(card);
            });
          }

          let showingAll = false;
          const toggleBtn = document.getElementById("toggleFaculty");
          toggleBtn.addEventListener("click", () => {
            showingAll = !showingAll;
            renderFaculty(showingAll ? facultyData.length : 8);
            toggleBtn.textContent = showingAll ? "Show Less" : "View All Faculties";
          });

          renderFaculty(8);


 // Smooth scrolling for all links
                document.querySelectorAll('a[href^="#"]').forEach(anchor => {
                    anchor.addEventListener('click', function (e) {
                        e.preventDefault();
                        
                        document.querySelector(this.getAttribute('href')).scrollIntoView({
                            behavior: 'smooth'
                        });
                    });
                });
                
                // Animate elements when they come into view
                const animateOnScroll = () => {
                    const elements = document.querySelectorAll('.section-title, .card, .facility-card, .teacher-card, .contact-card');
                    
                    elements.forEach(element => {
                        const elementPosition = element.getBoundingClientRect().top;
                        const screenPosition = window.innerHeight / 1.2;
                        
                        if (elementPosition < screenPosition) {
                            element.style.opacity = '1';
                            element.style.transform = 'translateY(0)';
                        }
                    });
                };
                
                // Set initial styles for animation
                document.addEventListener('DOMContentLoaded', () => {
                    const animatedElements = document.querySelectorAll('.section-title, .card, .facility-card, .teacher-card, .contact-card');
                    animatedElements.forEach(element => {
                        element.style.opacity = '0';
                        element.style.transform = 'translateY(20px)';
                        element.style.transition = 'opacity 0.5s ease, transform 0.5s ease';
                    });
                    
                    window.addEventListener('scroll', animateOnScroll);
                    animateOnScroll(); // Run once on load
                });
            
                // Mobile menu toggle functionality
                const mobileMenuButton = document.querySelector('.md\\:hidden');
                const navLinks = document.querySelector('nav');
                
                mobileMenuButton.addEventListener('click', () => {
                    navLinks.classList.toggle('hidden');
                    navLinks.classList.toggle('flex');
                    navLinks.classList.toggle('flex-col');
                    navLinks.classList.toggle('absolute');
                    navLinks.classList.toggle('top-16');
                    navLinks.classList.toggle('left-0');
                    navLinks.classList.toggle('right-0');
                    navLinks.classList.toggle('bg-white');
                    navLinks.classList.toggle('p-4');
                    navLinks.classList.toggle('shadow-md');
                });
                
                // Form submission
                const contactForm = document.querySelector('form');
                if (contactForm) {
                    contactForm.addEventListener('submit', (e) => {
                        e.preventDefault();
                        alert('Thank you for your enquiry. We will contact you soon.');
                        contactForm.reset();
                    });
                }